import React from 'react';
import "./welcome.css";
import logo from "../../images/logo.png"

const Welcome = () => {
  return (
    <div>
      <div>
        <img src={logo} className="logo-img" alt='logo'/>
      </div>
    </div>
  )
}

export default Welcome
